import React from 'react';

import candidates from '../candidates.json'

const Candidates = () => {
    return (
        <div>
            <ul>
                {candidates.map( candidate => <li key={candidate.id}> {candidate.name} </li>)}
            </ul>
        </div>
    )
}

export default Candidates;
